import React, { Component } from "react";
import "./tabs";
import Tab from "./tab/tab";

function Tabs(tabs) {
  return (
    <div className="tabs">
      tabs.map((tab, index) => <Tab key={index} tab={tab} index={index}></Tab>)
    </div>
  );
}
export default Tabs;
